import React, {useContext} from 'react';
import Avatar from "@material-ui/core/Avatar";
import Button from "@material-ui/core/Button";
import FormControl from "@material-ui/core/FormControl";

import LockOutlinedIcon from "@material-ui/icons/LockOutlined";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import withStyles from "@material-ui/core/styles/withStyles";
import styles from '../styles/FormStyles';
import useInputState from '../hooks/useInputState'
import { TextField } from '@material-ui/core'
function Index(props) {
    const {classes} = props;

    const [value, handleChange, reset] = useInputState("");
    console.log(value)
    return (
        <main className={classes.main}>
            <Paper className={classes.paper}>
                <Avatar className={classes.avatarClass}>
                    <LockOutlinedIcon/>
                </Avatar>
                <Typography variant='h5'>Date of Birth (yyyy-mm-dd)</Typography>
                <form className={classes.form}>
                    <FormControl margin='normal' required fullWidth>
                        <TextField
                            fullWidth
                            variant="outlined"
                            autoFocus
                            type="date"
                            id="dob"
                            name="dob"
                            label='Date of Birth (mm/dd/yyy)'
                            value={value}
                            onChange={handleChange}
                        >

                        </TextField>
                    </FormControl>
                    <Button variant='contained'   color='primary' className={classes.submitClass}>Male</Button>
                    <Button variant='contained'   color='primary' className={classes.submitClass}>Female</Button>
                    <br/>
                    <Button variant='contained'   color='primary' className={classes.submitClass}>Smoker</Button>
                    <Button variant='contained'   color='primary' className={classes.submitClass}>Non Smoker</Button>

                </form>
            </Paper>
        </main>
    )
}
export default withStyles(styles)(Index)


